const initialState = {
  account: {
    name: "",
    password: "",
    status: "",
    current: {}, //user object
  },
};

export default function signupFormReducer(state = initialState, action) {
  switch (action.type) {
    case "UPDATE_SIGNUP_FORM":
      return action.formData;
    case "ADD_ACCOUNT":
      return action.account;
    default:
      return state;
  }
}
